export const ResumeList = () => {
  const { data, isLoading, error } = useQuery({
    queryKey: ['resumes'],
    queryFn: async () => await resumesQuery(),
  });

  if (isLoading) {
    return <Spinner />;
  }
  if (error || !data) {
    return null;
  }
  if (!data.length) {
    return <EmptyState />;
  }

  return (
    <div
      className="grid grid-cols-1 gap-4 md:grid-cols-3 lg:grid-cols-5"
      data-test-id="resume-grid"
    >
      {data.map((item, idx) => (
        <ResumeItem key={item.id} item={item} idx={idx} />
      ))}
    </div>
  );
};
